import React from 'react';
import '../styles/portManagement.css';
import Icon from '../components/IconBlack';
import MainImage from '../components/componentImages/MainImage.png';
import { useNavigate } from 'react-router-dom';
import { logout } from "../helpers/Utils";

const styles = {
  Card: {
    width: '100%',
    backgroundColor: '#f0f0f0',
    borderRadius: '32px',
    padding: '20px',
    boxSizing: 'border-box',
    textAlign: 'center',
    cursor: 'pointer',
  },
  ImageContent: {
    flex: 1,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  Image: {
    width: '80%', // Increase the image size
    borderRadius: '20px',
  },
};

const Card = ({ children, onClick }) => {
  return (
    <div style={styles.Card} onClick={onClick}>
      {children}
    </div>
  );
};

export default function PortManagement() {
  const navigate = useNavigate();

  const handleNavigate = (path) => {
    navigate(path);
  };

  return (
    <div className="port-management-page">
      <Header />
      <div className="content">
        <div className="overview-section">
          <div className="text-content">
            <h1>Port Management</h1>
            <p>Efficiently manage port data with MyPort Manager</p>
            <div className="button-group">
              <ActionButton label="View" active />
              <ActionButton label="Edit" />
              <ActionButton label="Delete" />
              <ActionButton label="Create" />
            </div>
          </div>
          <div style={styles.ImageContent}>
            <img src={MainImage} alt="Main View" style={styles.Image} />
          </div>
        </div>
        <div className="cards-section">
          <Card onClick={() => handleNavigate('/real-time-container-updates')}>
            <h3>Real-time Container Updates</h3>
            <p>Stay informed with the latest container statuses.</p>
          </Card>
          <Card onClick={() => handleNavigate('/real-time-port-updates')}>
            <h3>Real-time Port Updates</h3>
            <p>Stay informed with the latest port statuses.</p>
          </Card>
          <Card onClick={() => handleNavigate('/downtime-updates')}>
            <h3>Downtime Updates</h3>
            <p>Enhanced Operations Management Dashboard</p>
          </Card>
          <Card onClick={() => handleNavigate('/machine-updates')}>
            <h3>Machine Updates</h3>
            <p>Enhanced Machine Management Dashboard</p>
          </Card>
          <Card onClick={() => handleNavigate('/real-time-shipment-updates')}>
            <h3>Real-time Shipment Updates</h3>
            <p>Enhanced Product Management Dashboard</p>
          </Card>
          <Card onClick={() => handleNavigate('/operation-tracking-system')}>
            <h3>Operation Tracking System</h3>
            <p>Enhanced Operations Management Dashboard</p>
          </Card>
        </div>
      </div>
    </div>
  );
}

function Header() {
  const navigate = useNavigate();

  const handleLogOut = () => {
    logout();
    navigate('/');
  };

  return (
    <header className="navbar">
      <div className="logo">
        <Icon />
        <span>MyPort Manager</span>
      </div>
      <nav className="nav-links">
        <LogoutButton onClick={handleLogOut} />
      </nav>
    </header>
  );
}

function ActionButton({ label, active }) {
  return (
    <button className={`action-button ${active ? 'active' : ''}`}>
      {label}
    </button>
  );
}

function LogoutButton({ onClick }) {
  return (
    <button
      className="sign-in-button"
      onClick={onClick}
      style={{
        color: 'white',
        padding: '5px 10px',
        width: '100%',
        height: 'auto',
      }}
    >
      Log Out
    </button>
  );
}
